  return (
    <div className="contact-me-container">
      <h2>Contact Me</h2>
      <p>Feel free to reach out to me through the following accounts:</p>
      <ul>
        <li><b>Email: </b>janadaribjv123@gmail.com</li>
        <li><b>LinkedIn: </b>https://www.linkedin.com/in/janadari-chandramali-samarakoon-650187191</li>
        <li><b>GitHub: </b>https://github.com/janadari123</li>
        
        <li><b>Sololearn: </b>https://www.sololearn.com/Profile/14891483/?ref=app</li>
      </ul>
    </div>
  );
};

export default ContactMe;
